import axios from 'axios';
import React from 'react';

function Adil() {
  const [DrinksCard, setDrinksCards] = React.useState([])
  React.useEffect(() => {
    axios
    .get('https://demo5518646.mockable.io/DrinksCard')
    .then((res) => {
      const data = res.data.card; // Извлекаем массив данных
      setDrinksCards(data);
    })
    .catch((error) => {
      console.error("Ошибка при получении данных:", error);
    });
}, []);



  return (
    <div>
      {DrinksCards = Array.isArray(DrinksCard)
  ? DrinksCard.map((card) => <li key={card.id}>{card.name}</li>)
  : null}
    </div>
  )
}

export default Adil
